class Albummatches {
  Albummatches({
    this.album,
  });

  Albummatches.fromJson(dynamic json) {
    if (json['album'] != null) {
      album = [];
      json['album'].forEach((v) {
        album?.add(Album.fromJson(v));
      });
    }
  }
  List<Album>? album;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (album != null) {
      map['album'] = album?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

